import styled from "@emotion/styled/macro";

export const Li = styled.li`
display: flex;
justify-content: space-between;
align-items: center;
margin: 1px auto;
color: #fff;
background: linear-gradient(
  90deg,
  rgba(255, 118, 20, 1) 0%,
  rgba(255, 84, 17, 1) 100%
);
padding: 16px;
border-radius: 5px;
width: 90%;
:hover ${IconContainer} {
  display: flex;
}
`
export const List = styled.div`
    width: auto;
    height: auto;
    background-color: transparent;
    border: none;
    color: black;
    font-size: 20px;
    margin-right: 15px;
`

export const Icons = styled.div`
    display: none;
`
